import { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom'
import '../Components/FormPages.css'
function EditForm(props) {
    const [val, setVal] = useState({ id: '', name: '', age: '', profile: '' })
    const params = useParams()
    
   const selectedData = props.data.filter((item)=>{
        return item.id === params.id
    })
    useEffect(()=>{
        setVal(selectedData)
    },[])

    return (
        <div>

            <form>
                <h3>Edit Form Id :{params.id}</h3>

                <label>Name : </label>
                <input placeholder="Name" value={val.name} /><br />

                <label>Age : </label>
                <input placeholder="Age" /><br />

                <label>profile : </label>
                <input placeholder="Profile" /><br />

                <button>Submit</button>
            </form>
        </div>
    )
}
export default EditForm
